import React, { useEffect } from "react";

export const SearchResult_Reflector = () =>{

    async function Google_Map_Operate() {
        let {Map} = await Google_Map_Operate.maps.importLibrary("maps")
    }

    useEffect(()=>{
        Google_Map_Operate()
            let Created_Map = new Map(
            document.getElementById(Google_Map),
                {
                    center:{ lat: -34.397, lng: 150.644 },
                    zoom: 8
                }
        )
    },[])

    return <React.Fragment>
        
                <div id='Google_Map'></div>

        </React.Fragment>

}

export default SearchResult_Reflector;
